4990a392-3b4c-4892-9e6c-76e6cecc9280	Clopidogrel-CYP2C19 Poor Metabolizer	d3dddc1d-8bc5-4714-b254-50dec124bbaf	{32638f99-ec66-41e9-87db-40b5f6c8d7d6}	For acute coronary syndrome (ACS) and percutaneous coronary intervention (PCI) cardiovascular indications: Avoid clopidogrel if possible. Use prasugrel or ticagrelor at standard dose if no contraindication. \n\nFor non-acute coronary syndrome (non-ACS) and non-percutaneous coronary intervention (non-PCI) cardiovascular indications: Avoid clopidogrel if possible. Consider an alternative P2Y12 inhibitor at standard dose if clinically indicated and no contraindication.\n\nFor neurovascular indications:  Avoid clopidogrel if possible. Consider an alternative P2Y12 inhibitor at standard dose if clinically indicated and no contraindication. Alternative P2Y12 inhibitors not impacted by CYP2C19 genetic variants include ticagrelor and ticlopidine. Prasugrel is contraindicated in patients with a history of stroke or transient ischemic attack (TIA). Selection of therapy should depend on individual patient treatment goals and risks for adverse events.	Lee CR, Luzum JA, Sangkuhl K, et al. Clinical Pharmacogenetics Implementation Consortium Guideline for CYP2C19 Genotype and Clopidogrel Therapy: 2022 Update. Clin Pharmacol Ther. 2022;112(5):959-967. doi:10.1002/cpt.2526	Warning (Yellow column)	Increased risk for adverse cardiac and cerebrovascular events and increased on-treatment platelet reactivity due to significantly reduced clopidogrel active metabolite formation.	5	t	2024-05-23 21:17:24.925327+00	2024-05-23 21:17:24.925327+00
f503feb9-7558-4ff5-bd66-16fad0cd8a5a	Clopidogrel-CYP2C19 Likely Poor Metabolizer	d3dddc1d-8bc5-4714-b254-50dec124bbaf	{32638f99-ec66-41e9-87db-40b5f6c8d7d6}	For acute coronary syndrome (ACS) and percutaneous coronary intervention (PCI) cardiovascular indications: Avoid clopidogrel if possible. Use prasugrel or ticagrelor at standard dose if no contraindication. \n\nFor non-acute coronary syndrome (non-ACS) and non-percutaneous coronary intervention (non-PCI) cardiovascular indications: Avoid clopidogrel if possible. Consider an alternative P2Y12 inhibitor at standard dose if clinically indicated and no contraindication.\n\nFor neurovascular indications:  Avoid clopidogrel if possible. Consider an alternative P2Y12 inhibitor at standard dose if clinically indicated and no contraindication. Alternative P2Y12 inhibitors not impacted by CYP2C19 genetic variants include ticagrelor and ticlopidine. Prasugrel is contraindicated in patients with a history of stroke or transient ischemic attack (TIA). Selection of therapy should depend on individual patient treatment goals and risks for adverse events.\n\nThe strength of recommendation for "likely" phenotypes are the same as their respective confirmed phenotypes. "Likely" indicates the uncertainty in the phenotype assignment, but it is reasonable to apply the recommendation for the confirmed phenotype to the corresponding "likely" phenotype.	Lee CR, Luzum JA, Sangkuhl K, et al. Clinical Pharmacogenetics Implementation Consortium Guideline for CYP2C19 Genotype and Clopidogrel Therapy: 2022 Update. Clin Pharmacol Ther. 2022;112(5):959-967. doi:10.1002/cpt.2526	Warning (Yellow column)	Increased risk for adverse cardiac and cerebrovascular events and increased on-treatment platelet reactivity due to significantly reduced clopidogrel active metabolite formation.	5	t	2024-05-23 21:17:24.925327+00	2024-05-23 21:17:24.925327+00
