c33b9bde-3627-44f0-920f-5f625d66c7a8	Amitriptyline-CYP2C19  Ultra-rapid Metabolizer	45477af2-958f-42d0-853a-8b9f9c7ce998	{32638f99-ec66-41e9-87db-40b5f6c8d7d6}	Avoid tertiary amine use due to potential for sub-optimal response. Consider alternative drug not metabolized by CYP2C19. Tricyclic antidepressants (TCAs) without major CYP2C19 metabolism include the secondary amines nortriptyline and desipramine. If a tertiary amine is warranted, utilize therapeutic drug monitoring to guide dose adjustments.\n\nDosing recommendations only apply to higher initial doses of TCAs for treatment of conditions such as depression. Patients may receive an initial low dose of a TCA, which is then increased over several days to the recommended steady state dose. The starting dose in the CPIC guideline refers to the recommended steady state dose. TCAs may be prescribed for alternative indications in which much lower dosing strategies are utilized such as neuropathic pain. Titrate dose to observed clinical response with symptom improvement and minimal (if any) side effects.	Hicks JK, Sangkuhl K, Swen JJ, et al. Clinical pharmacogenetics implementation consortium guideline (CPIC) for CYP2D6 and CYP2C19 genotypes and dosing of tricyclic antidepressants: 2016 update. Clin Pharmacol Ther. 2017;102(1):37-44. doi:10.1002/cpt.597	Caution (Yellow Column)	Greater conversion of tertiary amines to secondary amines may affect response or side effects due to increased metabolism of tertiary amines when compared to CYP2C19 normal metabolizers.	5	t	2024-05-23 21:17:24.925327+00	2024-05-23 21:17:24.925327+00
