b9f56f93-10e1-40f6-ae9e-6667d6c33f86	Efavirenz-CYP2B6 Intermediate Metabolizer	6969532a-6460-4419-b7c5-bbd455af3a11	{01b74a5e-f95b-4086-a5b7-899a8de1f228}	Consider initiating efavirenz with decreased dose of 400&nbsp;mg/day.  If therapeutic drug monitoring is available and a decreased efavirenz dose is prescribed, consider obtaining steady state plasma efavirenz concentrations to ensure concentrations are in the suggested therapeutic range (~1 to 4&nbsp;mcg/mL). To prescribe efavirenz at a decreased dose of 400&nbsp;mg/day or 200&nbsp;mg/day in a multidrug regimen may require prescribing more than one pill once daily. If so, the provider should weigh the potential benefit of reduced dose against the potential detrimental impact of increased pill number.	Desta Z, Gammal RS, Gong L, et al. Clinical Pharmacogenetics Implementation Consortium (CPIC) Guideline for CYP2B6 and Efavirenz-Containing Antiretroviral Therapy. Clin Pharmacol Ther. 2019;106(4):726-733. doi:10.1002/cpt.1477	Caution (Yellow Column)	Increased risk of central nervous system adverse events due to increased plasma concentrations when compared to CYP2B6 normal metabolizers.	5	t	2024-05-23 21:17:24.925327+00	2024-05-23 21:17:24.925327+00
f0c83e41-ae55-45ec-91cc-ff243bb9fc49	Efavirenz-CYP2B6 Poor Metabolizer	6969532a-6460-4419-b7c5-bbd455af3a11	{01b74a5e-f95b-4086-a5b7-899a8de1f228}	Consider initiating efavirenz with decreased dose of 400&nbsp;mg/day or 200&nbsp;mg/day.  If therapeutic drug monitoring is available and a decreased efavirenz dose is prescribed, consider obtaining steady state plasma efavirenz concentrations to ensure concentrations are in the suggested therapeutic range (~1 to 4&nbsp;mcg/mL). To prescribe efavirenz at a decreased dose of 400&nbsp;mg/day or 200&nbsp;mg/day in a multidrug regimen may require prescribing more than one pill once daily. If so, the provider should weigh the potential benefit of reduced dose against the potential detrimental impact of increased pill number.	Desta Z, Gammal RS, Gong L, et al. Clinical Pharmacogenetics Implementation Consortium (CPIC) Guideline for CYP2B6 and Efavirenz-Containing Antiretroviral Therapy. Clin Pharmacol Ther. 2019;106(4):726-733. doi:10.1002/cpt.1477	Caution (Yellow Column)	Significantly increased risk of central nervous system adverse events and treatment discontinuation due to increased plasma concentrations when compared to CYP2B6 normal metabolizers.	5	t	2024-05-23 21:17:24.925327+00	2024-05-23 21:17:24.925327+00
ee52d85b-5bfb-4ca4-8979-5acb5fd6aaab	Efavirenz-CYP2B6 Indeterminate	6969532a-6460-4419-b7c5-bbd455af3a11	{01b74a5e-f95b-4086-a5b7-899a8de1f228}	\N	Desta Z, Gammal RS, Gong L, et al. Clinical Pharmacogenetics Implementation Consortium (CPIC) Guideline for CYP2B6 and Efavirenz-Containing Antiretroviral Therapy. Clin Pharmacol Ther. 2019;106(4):726-733. doi:10.1002/cpt.1477	Standard Precautions (Green column)	\N	5	t	2024-05-23 21:17:24.925327+00	2024-05-23 21:17:24.925327+00
2540be8f-2a5d-4121-9514-7d547be6eef0	Tacrolimus-CYP3A5 Normal Metabolizer	0d36fae9-d172-4bed-ab68-125ee9d62392	{cd3bc960-aea4-40fb-a1ad-f54c10b7228b}	Increase starting dose 1.5 to 2 times recommended starting dose. Total starting dose should not exceed 0.3&nbsp;mg/kg/day. Use therapeutic drug monitoring to guide dose adjustments.\n\nThis recommendation includes the use of tacrolimus in kidney, heart, lung and hematopoietic stem cell transplant patients, and liver transplant patients where the donor and recipient genotypes are identical. Further dose adjustments or selection of alternative therapy may be necessary due to other clinical factors (e.g., medication interactions, or hepatic function). \n\nTypically with other CYP enzymes, a normal metabolizer would be classified as having "normal" metabolism, and therefore, the drug dose would not change based on the patient’s genotype. However, in the case of CYP3A5 and tacrolimus, a CYP3A5 expresser (i.e., CYP3A5 normal metabolizer or intermediate metabolizer) would require a higher recommended starting dose, and the CYP3A5 non-expresser (i.e., poor metabolizer) would require the standard recommended starting dose.	Birdwell KA, Decker B, Barbarino JM, et al. Clinical Pharmacogenetics Implementation Consortium (CPIC) Guidelines for CYP3A5 Genotype and Tacrolimus Dosing. Clin Pharmacol Ther. 2015;98(1):19-24. doi:10.1002/cpt.113	Caution (Yellow Column)	Decreased chance of achieving target tacrolimus concentrations due to increased metabolism when compared to CYP3A5 poor metabolizers.	5	t	2024-05-23 21:17:24.925327+00	2024-05-23 21:17:24.925327+00
517f2e8e-edc9-463d-baa3-bc3064f67e11	Tacrolimus-CYP3A5 Intermediate Metabolizer	0d36fae9-d172-4bed-ab68-125ee9d62392	{cd3bc960-aea4-40fb-a1ad-f54c10b7228b}	Increase starting dose 1.5 to 2 times recommended starting dose. Total starting dose should not exceed 0.3&nbsp;mg/kg/day. Use therapeutic drug monitoring to guide dose adjustments.\n\nThis recommendation includes the use of tacrolimus in kidney, heart, lung and hematopoietic stem cell transplant patients, and liver transplant patients where the donor and recipient genotypes are identical. Further dose adjustments or selection of alternative therapy may be necessary due to other clinical factors (e.g., medication interactions, or hepatic function). \n\nTypically with other CYP enzymes, a normal metabolizer would be classified as having "normal" metabolism, and therefore, the drug dose would not change based on the patient’s genotype. However, in the case of CYP3A5 and tacrolimus, a CYP3A5 expresser (i.e., CYP3A5 normal metabolizer or intermediate metabolizer) would require a higher recommended starting dose, and the CYP3A5 non-expresser (i.e., poor metabolizer) would require the standard recommended starting dose.	Birdwell KA, Decker B, Barbarino JM, et al. Clinical Pharmacogenetics Implementation Consortium (CPIC) Guidelines for CYP3A5 Genotype and Tacrolimus Dosing. Clin Pharmacol Ther. 2015;98(1):19-24. doi:10.1002/cpt.113	Caution (Yellow Column)	Decreased chance of achieving target tacrolimus concentrations due to increased metabolism when compared to CYP3A5 poor metabolizers.	5	t	2024-05-23 21:17:24.925327+00	2024-05-23 21:17:24.925327+00
24b93eee-c881-43d9-90b8-4f98fcf733fd	Celecoxib-CYP2C9 Intermediate Metabolizer	211b33bf-72c3-4545-a4b2-ea558809d086	{e8d718e4-4831-496c-8448-16ad044c2e9d}	Initiate therapy with lowest recommended starting dose. Titrate dose upward to clinical effect or maximum recommended dose with caution. In accordance with the prescribing information, use the lowest effective dosage for shortest duration consistent with individual patient treatment goals. Carefully monitor adverse events such as blood pressure and kidney function during course of therapy. \n\nIntermediate metabolizers might have a higher than normal risk of adverse events especially in individuals with other factors affecting clearance of these drugs such as hepatic impairment or advanced age.	Theken KN, Lee CR, Gong L, et al. Clinical Pharmacogenetics Implementation Consortium Guideline (CPIC) for CYP2C9 and Nonsteroidal Anti-Inflammatory Drugs. Clin Pharmacol Ther. 2020;108(2):191-200. doi:10.1002/cpt.1830	Caution (Yellow Column)	Increased probability of toxicities due to moderately reduced metabolism and higher plasma concentrations.	5	t	2024-05-23 21:17:24.925327+00	2024-05-23 21:17:24.925327+00
