a9123596-3d31-4156-9c2f-5c24dae4b8ff	Mercaptopurine-TPMT Indeterminate & NUDT15 Intermediate Metabolizer	0e38efb2-fc40-4421-ab75-aaa7e5a0d4c6	{daa86f03-86c6-4a8d-abab-476fcd043c9c,9ca2999f-1b56-4ee8-a254-2da4415cbb72}	Based NUDT15 status, start with reduced starting doses (30%&#8208;80% of normal dose) if normal starting dose is ≥75&nbsp;mg/m&#178;/day or ≥1.5&nbsp;mg/kg/day (e.g., start at 22.5&#8208;60&nbsp;mg/m&#178;/day or 0.45&#8208;1.2&nbsp;mg/kg/day) and adjust doses of mercaptopurine based on degree of myelosuppression and disease-specific guidelines. Allow 2&#8208;4 weeks to reach steady state after each dose adjustment. If myelosuppression occurs, and depending on other therapy, emphasis should be on reducing mercaptopurine over other agents. If normal starting dose is already &lt;75&nbsp;mg/m&#178;/day or &lt;1.5&nbsp;mg/kg/day, dose reduction may not be recommended. \n\nTPMT phenotype could not be assigned based on genotyping. Consider evaluating TPMT erythrocyte activity to assess TPMT phenotype. If thiopurines are required and TPMT status is unknown, monitor closely for toxicity.	Relling MV, Schwab M, Whirl-Carrillo M, et al. Clinical Pharmacogenetics Implementation Consortium Guideline for Thiopurine Dosing Based on TPMT and NUDT15 Genotypes: 2018 Update. Clin Pharmacol Ther. 2019;105(5):1095-1105. doi:10.1002/cpt.1304 and General background text Pharmacogenetics – <em>Nudixhydrolase 15 (NUDT15)</em>. Published online November 5, 2018. Accessed November 13, 2023. https://www.pharmgkb.org/page/dpwgMapping	Caution (Yellow Column)	Increased risk of thiopurine-related leukopenia, neutropenia, and/or myelosuppression.	5	t	2024-05-23 21:17:24.925327+00	2024-05-23 21:17:24.925327+00
