86aaf5d3-990d-4211-b717-60da64f6fca4	Atomoxetine-CYP2D6 Normal Metabolizer	b42d7cb5-1fbb-4800-853c-56ed56c71801	{aba94ef2-e507-4963-84dd-24dc2d4f7ffc}	Initiate with a dose of 40&nbsp;mg/day and increase to 80&nbsp;mg/day after 3 days. If no clinical response and in the absence of adverse events after 2 weeks, consider increasing dose to 100&nbsp;mg/day. If no clinical response observed after 2 weeks, consider obtaining a peak plasma concentration (1 to 2 hours after dose administered). If &lt;200&nbsp;ng/mL, consider a proportional increase in dose to approach 400&nbsp;ng/mL. Dosages greater than 100&nbsp;mg/day may be needed to achieve target concentrations.\n\nTherapeutic range of 200 to 1000&nbsp;ng/mL has been proposed. Limited data are available regarding the relationship between atomoxetine plasma concentrations and clinical response. Available information suggests that clinical response is greater in poor metabolizers (PMs) compared to non-PMs and may be related to the higher plasma concentrations 1 to 1.5 hours after dosing in PMs compared to non-PMs administered a similar dose. Furthermore, modest improvement in response, defined as reduction in ADHD-rating scale, is observed at peak concentrations >400&nbsp;ng/mL. Doses above 120&nbsp;mg/day have not been evaluated.	Brown JT, Bishop JR, Sangkuhl K, et al. Clinical Pharmacogenetics Implementation Consortium Guideline for <em>Cytochrome P450 (CYP)2D6 </em> Genotype and Atomoxetine Therapy. Clin Pharmacol Ther. 2019;106(1):94-102. doi:10.1002/cpt.1409	Caution (Yellow Column)	Normal metabolizers of atomoxetine have a lower likelihood of response when compared to poor metabolizers. This is associated with increased discontinuation due to lack of efficacy when compared to CYP2D6 poor metabolizers.	5	t	2024-05-23 21:17:24.925327+00	2024-05-23 21:17:24.925327+00
6c39d722-fa9e-4fe7-98d1-4cff6a5d4b2b	Atomoxetine-CYP2D6 Ultra-rapid Metabolizer	b42d7cb5-1fbb-4800-853c-56ed56c71801	{aba94ef2-e507-4963-84dd-24dc2d4f7ffc}	Initiate with a dose of 40&nbsp;mg/day and increase to 80&nbsp;mg/day after 3 days. If no clinical response and in the absence of adverse events after 2 weeks, consider increasing dose to 100&nbsp;mg/day. If no clinical response observed after 2 weeks, consider obtaining a peak plasma concentration (1 to 2 hours after dose administered). If &lt;200&nbsp;ng/mL, consider a proportional increase in dose to approach 400&nbsp;ng/mL. Dosages greater than 100&nbsp;mg/day may be needed to achieve target concentrations.\n\nTherapeutic range of 200 to 1000&nbsp;ng/mL has been proposed. Limited data are available regarding the relationship between atomoxetine plasma concentrations and clinical response. Available information suggests that clinical response is greater in poor metabolizers (PMs) compared to non-PMs and may be related to the higher plasma concentrations 1 to 1.5 hours after dosing in PMs compared to non-PMs administered a similar dose. Furthermore, modest improvement in response, defined as reduction in ADHD-rating scale, is observed at peak concentrations >400&nbsp;ng/mL. Doses above 120&nbsp;mg/day have not been evaluated.	Brown JT, Bishop JR, Sangkuhl K, et al. Clinical Pharmacogenetics Implementation Consortium Guideline for <em>Cytochrome P450 (CYP)2D6 </em> Genotype and Atomoxetine Therapy. Clin Pharmacol Ther. 2019;106(1):94-102. doi:10.1002/cpt.1409	Caution (Yellow Column)	Based on very limited data available for CYP2D6 ultra-rapid metabolizers taking atomoxetine, it is unlikely ultra-rapid metabolizers would achieve adequate serum concentrations for the intended effect at standard dosing.	5	t	2024-05-23 21:17:24.925327+00	2024-05-23 21:17:24.925327+00
5a380c5b-1642-4f36-b9ad-8c533b2208fc	Atomoxetine-CYP2D6 Intermediate Metabolizer	b42d7cb5-1fbb-4800-853c-56ed56c71801	{aba94ef2-e507-4963-84dd-24dc2d4f7ffc}	Initiate with a dose of 40&nbsp;mg/day and if no clinical response and in the absence of adverse events after 2 weeks increase dose to 80&nbsp;mg/day. If response is inadequate after 2 weeks consider obtaining a plasma concentration 2&#8208;4 hours after dosing. If concentration is &lt;200&nbsp;ng/mL, consider a proportional dose increase to achieve a concentration to approach 400&nbsp;ng/mL. If unacceptable side effects are present at any time, consider a reduction in dose.\n\nTherapeutic range of 200 to 1000&nbsp;ng/mL has been proposed. Limited data are available regarding the relationship between atomoxetine plasma concentrations and clinical response. Available information suggests that clinical response is greater in poor metabolizers (PMs) compared to non-PMs and may be related to the higher plasma concentrations 1 to 1.5 hours after dosing in PMs compared to non-PMs administered a similar dose. Furthermore, modest improvement in response, defined as reduction in ADHD-rating scale, is observed at peak concentrations >400&nbsp;ng/mL.	Brown JT, Bishop JR, Sangkuhl K, et al. Clinical Pharmacogenetics Implementation Consortium Guideline for <em>Cytochrome P450 (CYP)2D6 </em> Genotype and Atomoxetine Therapy. Clin Pharmacol Ther. 2019;106(1):94-102. doi:10.1002/cpt.1409	Caution (Yellow Column)	Higher plasma concentrations may increase the probability of side effects due to decreased metabolism when compared to CYP2D6 normal metabolizers. Intermediate metabolizers may be at an increased risk of discontinuation due to reduced efficacy when compared to CYP2D6 poor metabolizers.	5	t	2024-05-23 21:17:24.925327+00	2024-05-23 21:17:24.925327+00
ad130cf0-dd4f-4f2c-9a78-8c76bc7a794d	Atomoxetine-CYP2D6 Poor Metabolizer	b42d7cb5-1fbb-4800-853c-56ed56c71801	{aba94ef2-e507-4963-84dd-24dc2d4f7ffc}	Initiate with a dose of 40&nbsp;mg/day and if no clinical response and in the absence of adverse events after 2 weeks increase dose to 80&nbsp;mg/day. If response is inadequate after 2 weeks, consider obtaining a plasma concentration 2&#8208;4 hours after dosing. If concentration is &lt;200&nbsp;ng/mL, consider a proportional dose increase to achieve a concentration to approach 400&nbsp;ng/mL. If unacceptable side effects are present at any time, consider a reduction in dose.\n\nTherapeutic range of 200 to 1000&nbsp;ng/mL has been proposed. Limited data are available regarding the relationship between atomoxetine plasma concentrations and clinical response. Available information suggests that clinical response is greater in poor metabolizers (PMs) compared to non-PMs and may be related to the higher plasma concentrations 1 to 1.5 hours after dosing in PMs compared to non-PMs administered a similar dose. Furthermore, modest improvement in response, defined as reduction in ADHD-rating scale, is observed at peak concentrations >400&nbsp;ng/mL.	Brown JT, Bishop JR, Sangkuhl K, et al. Clinical Pharmacogenetics Implementation Consortium Guideline for <em>Cytochrome P450 (CYP)2D6 </em> Genotype and Atomoxetine Therapy. Clin Pharmacol Ther. 2019;106(1):94-102. doi:10.1002/cpt.1409	Caution (Yellow Column)	Significantly decreased metabolism of atomoxetine may result in higher concentrations when compared to non-poor metabolizers. This may increase the occurrence of treatment-emergent side effects, but also a greater improvement of ADHD symptoms as compared to non-poor metabolizers in those who tolerate treatment. Poor metabolizer status is associated with lower final dose requirements as compared to non-poor metabolizers.	5	t	2024-05-23 21:17:24.925327+00	2024-05-23 21:17:24.925327+00
